#=
Sympy would not solve the system of equations resulting from the Lagragian.
This is why I solved the Lagrange equations in naive_lagrange_from_mathematica.nb and exported the results to a text file. 
This was however made for Fortran, so still a few modifications were needed to make it work in Julia.
This was done by "str + h" to replace/change the following
Cos -> cos
Sin -> sin
Sqrt -> sqrt
Derivative(1)(α)(t)  -> alpha_dot
Derivative(1)(β)(t)  -> beta_dot
Derivative(1)(γ)(t)  -> gamma_dot
** -> ^
.* -> *
=#


# used to convert from omega to angle_dot
function omega_to_angle_dot(alpha, beta, gamma, omega1, omega2, omega3)
    alpha_dot = omega1 *cos(beta) + omega3*sin(beta)
    beta_dot =  (omega1*sin(beta) - omega3*cos(beta))*tan(alpha) + omega2
    gamma_dot = (-omega1*sin(beta) + omega3*cos(beta))/cos(alpha)
    return alpha_dot, beta_dot, gamma_dot
end

# using to convert from angle_dot to omega
function angle_dot_to_omega(alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot)
    omega1 = alpha_dot*cos(beta) - gamma_dot*cos(alpha)*sin(beta)
    omega2 = beta_dot + gamma_dot*sin(alpha)
    omega3 = alpha_dot*sin(beta) + gamma_dot*cos(alpha)*cos(beta)
    return omega1, omega2, omega3
end


