# define the ode
function dydt_Lagrange(y, p, t)
    alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot = y
    (g, m, h, A, B, C, F, a, b, c) = p

    alpha_dotdot = alpha_ddot(alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot,  g, m, h, a, b, c, A, B, C, F,)
    beta_dotdot = beta_ddot(alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot,  g, m, h, a, b, c, A, B, C, F,)
    gamma_dotdot = gamma_ddot(alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot,  g, m, h, a, b, c, A, B, C, F,)

    return [alpha_dot, beta_dot, gamma_dot, alpha_dotdot, beta_dotdot, gamma_dotdot]
end

# set up the original schömer problem for Lagrange
function set_up_original_problem_for_Lagrange(y0_all_angles)
    # Geometric parameters of the rattleback
    a = 0.5 * (1 + √(5))
    b = 1
    c = 1


    g = 9.81
    # calculating the total mass and the height/ distance center of mass and 0
    mE = 0.1
    mp = 0.05
    m = mE + 2 * mp
    h = mE / m * 3 * c/ 8

    A, B, C, F =  0.05796875, 0.0903294297749979, 0.12236067977499791, 0.025

    parameter = (g=g, m=m, h=h, A=A, B=B, C=C, F=F, a=a, b=b, c=c)


    alpha_dot, beta_dot, gamma_dot = omega_to_angle_dot(y0_all_angles...)

    y0 = [y0_all_angles[1:3]..., alpha_dot, beta_dot, gamma_dot]

    tspan = (0.0, 60.0)

    return y0, tspan, parameter
end


# plot the omegas for lagrange solution
function plot_lagrange_omega(sol, ylims)

    omega1 = zeros(length(sol))
    omega2 = zeros(length(sol))
    omega3 = zeros(length(sol))
    for i in 1:length(sol)
        alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot = sol[:, i]
        omega1[i], omega2[i], omega3[i] = angle_dot_to_omega(alpha, beta, gamma, alpha_dot, beta_dot, gamma_dot)
    end

    lw = 2
    fontsize = 14
    fontsize2 = 18
    
    p = plot(sol.t, omega1, label=L"\omega_1",
    xguide = L"t",
    yticks = [],
    title = "Lagrange-Formulierung",
    legend=false,
    titlefont = font(fontsize2,"Computer Modern"),
    guidefont = font("Computer Modern"),
    legendfont = font(fontsize,"Computer Modern"),
    size = (700, 500),
    grid = true,
    xlims=(first(sol.t), last(sol.t)),
    dpi = 300,
    ylims = ylims,
    lw = lw,
    legendfontsize=fontsize,
    xtickfontsize=fontsize,
    ytickfontsize=fontsize,
    ylabelfontsize=fontsize2,
    xlabelfontsize=fontsize2,
    )


    plot!(sol.t, omega2, label=L"\omega_2", lw = lw)
    plot!(sol.t, omega3, label=L"\omega_3", lw = lw)


    return p
end